    counts = {}
    for i in arr:
        key = ''.join((str(x) for x in i))
        counts[key] = counts.get(key, 0) - 1
    subarrays = [(tuple(map(lambda x: x if x != "' " else ' ', k.replace('[', '').replace(']', '').replace("', '", ' ').split(','))), v) for (k, v) in counts.items() if v > 1]
    return subarrays

